(function(){const URL="https://script.google.com/macros/s/AKfycby-tt7UY_tChKNxfYY6OLTiDqOiDNnIr5wvnnkpksPzXUx970S_dL2QKELnSOCWi_i9/exec";async function post(action,payload){try{const r=await fetch(URL,{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({action,payload})});return await r.json();}catch(e){console.error(e);return null}}window.CloudSync={saveAll:async function(){return await post('save',{} )},loadAndMerge:async function(){try{const r=await fetch(URL+'?action=load');const j=await r.json();return j}catch(e){return null}}} })();